import React from 'react';
import { Outlet } from 'react-router-dom';

const AdminLayout = () => {
    return (
        <div>
            {/* Admin Navbar */}
            <nav style={{ backgroundColor: '#333', color: '#fff', padding: '10px' }}>
                <h3>Admin Dashboard</h3>
                <ul style={{ listStyle: 'none', display: 'flex', gap: '20px' }}>
                    <li><a href="/admin" style={{ color: '#fff' }}>Home</a></li>
                    <li><a href="/admin/artists" style={{ color: '#fff' }}>Manage Artists</a></li>
                    <li><a href="/admin/bookings" style={{ color: '#fff' }}>Manage Bookings</a></li>
                    <li><a href="/logout" style={{ color: '#fff' }}>Logout</a></li>
                </ul>
            </nav>

            {/* Content Area */}
            <div style={{ padding: '20px' }}>
                <Outlet /> {/* Renders child routes */}
            </div>
        </div>
    );
};

export default AdminLayout;
